  false,\n\t\"url\": null,\n\t\"notes\": \"NYCDOT's Traffic Management Center (TMC)
  maintains a map of traffic speed detectors throughout the City. The speed detector
  themselves belong to various city and state agencies. The Traffic Speeds Map is
  available on the DOT's website (http://nyctmc.org/ ). This data feed contains 'real-time'
  traffic information from locations where NYCDOT picks up sensor feeds within the
  five boroughs, mostly on major arterials and highways. NYCDOT uses this information
  for emergency response and management.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
